(56914, 36444, 0, 1, '哀憐.', '', '2012-12-09 00:00:00', 2000, 20, 2, 1, '黑暗中慢慢睜開迷濛的眼\n看不清四周大雨模糊視線\n遍地傷痛覆蓋荒野\n血染這一夜\n\n看見自己陌生的臉\n分不清黑與白的真實虛偽\n遠處傳來誰的哀憐\n一路穿越絕望的明天\n\ni hope you cry for me\ni hope you hihe my fears\ntake away these guilt and all of my pains\n\n伸出手卻碰不到你的側臉\n伸出手卻握不住幸福碎片\n不願去想對錯是非\n就讓眼淚凝結這瞬間\n\n的思念 將淚水帶往三千世界 的終點\n那我呢 我的夜 卻永遠 走不出 漆黑\n\n鮮血染紅了雪白的衣袖\n絕望覆蓋上潰爛的傷口\n當承諾退色斑駁\n當期盼碎裂剝落\n是不是憐憫到盡頭\n失了心而瘋\n\n腳步踩上了微弱的祈求\n空洞的靈魂住進了心魔\n流年飛逝　暮然回首\n看子夜中的流星墜落\n才發現自己無歸處的夢\n\n黑暗中慢慢睜開迷濛的眼\n看不清四周大雨模糊視線\n遍地傷痛覆蓋荒野\n血染這一夜\n\n觸碰不到你的側臉\n伸出手卻握不住幸福碎片\n不願去想對錯是非\n就讓眼淚凝結這瞬間 \n\n的思念 將淚水帶往三千世界 的終點\n那我呢 我的夜 誰帶我 走出這 冬天\n\n鮮血染紅了雪白的衣袖\n絕望覆蓋上潰爛的傷口\n當承諾退色斑駁\n當期盼碎裂剝落\n是不是憐憫到盡頭\n失了心而瘋\n\n腳步踩上了微弱的祈求\n空洞的靈魂住進了心魔\n流年飛逝 暮然回首\n看子夜中的流星墜落\n才發現自己\n\n擁有過 曾經擁有過 曾經擁有夢\n就讓 野火燒盡癡狂 痛過以後\n才明白轉身後 自己要的是什麼\n\n希望有天 看見 遠方彩虹 把傷心都解凍\n不再獨飲這落寞', '', 273, '', '蕊 lycoris', '蕊 lycoris', '蕊 lycoris 、北斗', '', '', 1, 1, 0, '2012-12-09 14:38:14', '2015-03-12 13:57:21', '0000-00-00 00:00:00'),
