(56918, 142335, 4172, 25, '離開', '', '2012-03-20 00:00:00', 2000, 0, 1, 5, '回憶是一片空白\r\n卻容不下妳的愛\r\n我的期待對你是種傷害\r\n你留下的漫長等待\r\n妳離開的太快我放不開\r\n愛不愛無法衡量買賣\r\n是該釋懷我期待的愛\r\n重新彩繪全新空白\r\n*\r\n分手的理由會不會太明白\r\n求你從我的世界裡走開\r\n你無法給我我想要的愛\r\n證明我不存在\r\n看著劇本的對白\r\n我明白你為何要離開\r\n酸苦難嚥的愛是多麼悲哀\r\n確是我唯一能留住的愛\r\n那是我一輩子的愛\r\n', '', 246, '', '齊賢', '齊賢', 'Jimmy', '', '', 0, 0, 0, '2012-12-09 18:52:31', '2015-03-12 13:57:21', '0000-00-00 00:00:00'),
