(56920, 91296, 0, 1, '沒有一定', '', '2012-12-09 00:00:00', 2000, 0, 2, 7, '這是一種沒有旋律的歌 因為我不太會唱歌 那又如何\r\n\r\n別人一句話 就能讓你活過去 也能讓你死去 徘徊著自己\r\n\r\n記憶深處的過去 弄傷著自己\r\n\r\n誰說 風一定往哪吹 就一定在哪出現\r\n\r\n誰說 孤單是一種美 美的掉淚\r\n', '', 86, '', '桃利煬', '桃利煬', '桃利煬', '', '', 0, 1, 0, '2012-12-09 20:34:02', '2015-03-12 13:57:22', '0000-00-00 00:00:00'),
