(56925, 62286, 0, 1, '男子漢 BROTHER (demoo)', '', '2012-12-09 00:00:00', 2000, 0, 2, 1, '男子漢\r\n\r\n等待思念撞擊腦袋\r\n迫不及待將自由拋開\r\n就像紅燈默數著反拍\r\n\r\n我不像你 任意揮霍\r\n別人為你留的金銀色彩\r\n我也知道你其實不以為然\r\n\r\n就這樣 時針慢慢旋轉\r\n沒有人管 他走了多少個世代\r\n\r\n失望越過大海\r\n失敗已經不在\r\n怎麼情緒還沒法轉換\r\n\r\n你愛得死去活來\r\n又說遲早分開\r\n選擇一個無法忘懷的夜晚\r\n\r\n太有魅力容易變壞\r\n失去才懂擁有 是悲哀\r\n男子漢應該學會承擔\r\n\r\n就這樣 時針難已倒轉\r\n沒有人管 他繞了多少個世代\r\n \r\n不再等待命運安排\r\n要更自由自在\r\n無論結局是好或是  壞\r\n\r\n就儘管放馬過來\r\n我已準備應戰\r\n我愛你就不會被打敗\r\n\r\n不必要的路經過的旅途心靈也乾枯\r\n但陽光輕易的  照著不曾看見的孤獨\r\n\r\noh\r\n時光越過了人海\r\n失敗已經不在\r\n找一個浪漫渡過黑暗\r\n\r\n就大膽放馬過來\r\n忘掉你所有的愛\r\n無論結局是好或是壞\r\n\r\n給我不甘願的遺憾\r\n撕掉重新再來\r\n享受著過程拒絕貪玩 \r\n\r\n就儘管放馬過來\r\n我已準備應戰\r\n我愛你就不會被打敗\r\n\r\n等待思念撞擊腦袋\r\n迫不及待將自由拋開\r\n就像紅燈默數著反拍\r\n', '', 208, '', 'ALIICE', 'ALIICE', '', '', '', 0, 1, 0, '2012-12-09 23:03:56', '2015-03-12 13:57:22', '0000-00-00 00:00:00'),
(56926, 62286, 0, 1, '孤獨人類 human lonely (demoo)', '', '2012-12-09 00:00:00', 2000, 0, 2, 1, '孤獨人類 \r\n\r\n什麼時候 留著言 不見面\r\n替代的一切 讓夜不成眠\r\n說好的時間 交叉的地點\r\n什麼時候 開始不相信誰\r\n\r\n不斷纏綿\r\n不斷糾結\r\n解釋著一切\r\n\r\n孤獨人類享受不到一點點安慰\r\n錯把關懷看成虛偽\r\n假如可以靜靜擁抱一絲絲痛覺\r\n何苦掙扎在這世界\r\n\r\n緊閉雙眼  才能看得見\r\n\r\n\r\n如果不用語言 就能用心體會\r\n那又何必藉著文字訴說一切\r\n每個名子依賴每一張臉\r\n孤獨就在此刻劃清界線\r\n\r\n不斷留戀\r\n不斷改變\r\n掩飾著一切\r\n\r\n\r\n孤獨人類享受著流言蜚語相會\r\n錯把欺騙當成專業\r\n倘若可以盡情剪掉一根根痛覺\r\n也無需活在這世界\r\n\r\n忍耐極限 才能看得見\r\n\r\n\r\n孤獨人類享受不到一點點安慰\r\n錯把關懷看成虛偽\r\n假如可以靜靜擁抱一絲絲痛覺\r\n何苦掙扎在這世界\r\n就算每天彷彿洗了又髒的T桖\r\n遇到陽光還是耀眼\r\n一起走吧!手牽手勇敢大步向前\r\n大膽活在感覺邊緣\r\n\r\n失望堆疊  也請期待 \r\n夢想蛻變 幸福的瞬間 炎熱的夏天', '', 261, '', 'ALIICE', 'ALIICE', '', '', '', 0, 1, 0, '2012-12-09 23:18:36', '2015-03-12 13:57:22', '0000-00-00 00:00:00'),
(56927, 62286, 0, 1, '雨滴滴 Rainy (demoo)', '', '2012-12-09 00:00:00', 2000, 0, 2, 4, '雨滴滴\r\n\r\n濕冷冷的空氣\r\n雲朵凋零的痕跡\r\n沒有什麼原因\r\n憂愁散也散不去\r\n\r\n突然下起了雨\r\n雨冰冷我的心\r\n習慣了 沒有關係!\r\n因為你早離去\r\n帶走所有回憶\r\n留半個我在這裡 偷偷想你\r\n\r\n是什麼住心裡\r\n彷彿末日的來臨\r\n有沒有遙控器\r\n能把心聲轉最低\r\n\r\n突然下起了雨\r\n雨冰冷我的心\r\n習慣了 沒有關係!\r\n因為你早離去\r\n帶走所有回憶\r\n留半個我在這裡 偷偷想你\r\n\r\n一閃一閃亮晶晶\r\n我卻以為是星星閃耀著愛情\r\n世界不是只有你\r\n我怎麼還沒清醒\r\n讓一切都歸零\r\n\r\n下起了雨\r\n雨冰冷我的心\r\n沒有你 我也可以!\r\n因為你早離去\r\n帶走所有回憶\r\n留半個我在這裡\r\n\r\n太陽總會放晴\r\n末日不會來臨\r\n相信不離不棄的雨\r\n因為你早離去\r\n帶走所有回憶\r\n留半個我在這裡 偷偷想你 不要哭泣', '', 203, '', 'ALIICE', 'ALIICE', '', '', '', 0, 1, 0, '2012-12-09 23:21:17', '2015-03-12 13:57:22', '0000-00-00 00:00:00'),
(56928, 62286, 0, 1, '幸運二選一 Lucky Choose (demoo)', '', '2012-12-09 00:00:00', 2000, 0, 2, 4, '幸運二選一  \r\n\r\n\r\n紅色或黃色總猶豫不定\r\n要走左邊或右邊看起來容易\r\n搖搖頭不是 我最拿手才藝\r\n少了你 我會不會 變聰明\r\n\r\n這世界 考驗著多少懷疑\r\n而你是幸運星\r\n陪伴我 選擇光明\r\n\r\n不要緊 一起倒數著悲劇\r\n暫時不傷心\r\n二選一的難題\r\n沒有你不會成立\r\n\r\n\r\n要被欺騙多少次才不輕易相信\r\n到底開心不開心也沒有定義\r\n把不走的是 那一陣陣道理\r\n沒有你 我會不會 更積極\r\n\r\n這世界 違背了多少善意\r\n而你是幸運星\r\n照耀那 黑色路徑\r\n\r\n不要緊 一起倒數著悲劇\r\n暫時不傷心\r\n我的選項有你\r\n人生才會有意義\r\n\r\n\r\n\r\n這世界 消失了多少愛情\r\n而你是幸運星\r\n選擇我 一起回憶\r\n\r\n不放棄 一起完成這悲劇\r\n暫時不傷心\r\n二選一的難題\r\n沒有你不會成立', '', 207, '', 'ALIICE', 'ALIICE', '', '', '', 0, 1, 0, '2012-12-09 23:24:03', '2015-03-12 13:57:22', '0000-00-00 00:00:00'),
(56929, 62286, 0, 1, '吃飯睡覺刷牙漱口 Life (demoo)', '', '2012-12-09 00:00:00', 2000, 0, 2, 4, '吃飯睡覺刷牙漱口\r\n\r\n又到了離別時候\r\n曾經牽著手一起走過\r\n這是個驚喜又美麗的旅程\r\n像種子隨風的降落\r\n\r\n不管未來朝生活或夢想而忙碌的奔走\r\n也要記得 吃飯睡覺刷牙漱口\r\n不管未來是開心或難過 請不要一個人走\r\n因為我們是永遠的朋友\r\n\r\n最討厭離別時候\r\n我們互相交換的夢\r\n那是一個未知又期待的旅程\r\n像帆船在海上漂流\r\n\r\n不管未來朝生活或夢想而忙碌的奔走\r\n也要記得 吃飯睡覺刷牙漱口\r\n不管未來是開心或難過 請不要一個人走\r\n因為我們是永遠的朋友\r\n\r\n我會一直陪在你左右', '', 153, '', 'ALIICE  ', 'ECHO', '', '', '', 0, 1, 0, '2012-12-09 23:34:10', '2015-03-12 13:57:22', '0000-00-00 00:00:00'),
(56930, 62286, 0, 1, '分手信 Dear John letter (demoo)', '', '2012-12-09 00:00:00', 2000, 0, 2, 4, '分手信   詞曲ALIICE\r\n \r\n你喜歡哪一種生活\r\n還是你也有相同感受\r\n我愛你太多 沒有用\r\n讓眼淚 去揮霍\r\n\r\n \r\n你討厭哪一種幽默\r\n還是你就想出去走走\r\n對不起太多 沒有用\r\n讓偽裝 去承受\r\n\r\n不想再看見你的背影\r\n沒有能力高估我自己                                     \r\n長不大的是我還是你  請用盡全力  讓我不要相信\r\n\r\n\r\n\r\n我們總是不願相信\r\n童話故事的美好結局\r\n也許等到那天降臨\r\n一切都 來不及\r\n\r\n假設性的問題 始終不回應\r\n以為逃避就會幸運      \r\n我也不想變得冷血無情\r\n我也受不了  自己反覆情緒\r\n\r\n\r\n不可能再保留著香氣\r\n是誰努力維持著關係\r\n最害怕的是沉默不語   請不要說這是一首分手信\r\n\r\n不想再看見你的背影\r\n沒有能力高估我自己\r\n長不大的是我還是你    請用盡全力  讓我不要相信\r\n', '', 203, '', 'ALIICE', 'ALIICE', '', '', '', 0, 1, 0, '2012-12-09 23:39:11', '2015-03-12 13:57:22', '0000-00-00 00:00:00'),
